import { NextConfig } from "next";

const nextConfig: NextConfig = {
  output: "export",          // wajib supaya bisa static export
  images: {
    unoptimized: true,       // wajib kalau pakai next/image
  },
  // kalau hosting di repo GitHub Pages subpath, misal repo "my-app"
  // aktifkan basePath & assetPrefix
  // basePath: "/my-app",
  // assetPrefix: "/my-app/",
};

export default nextConfig;
